import React, { useState } from "react";
import { NavLink } from "react-router-dom";
import searchIcon from "../assets/search_icon.png";
import profileIcon from "../assets/profile_icon.png";
import cartIcon from "../assets/cart_icon.png";
import logo from "../assets/craspedia_bw.png";

const Navbar = () => {
  const [isMenuOpen, setIsMenuOpen] = useState(false);

  return (
    <div className="flex justify-between items-center fixed top-0 left-0 w-full bg-white/90 backdrop-blur-lg shadow-md py-4 px-10 z-50">
      <NavLink to="/">
        <img src={logo} alt="logo" className="w-8 h-8 cursor-pointer" />
      </NavLink>

      <div className="lg:hidden">
        <button
          className="text-black"
          onClick={() => setIsMenuOpen((prev) => !prev)}
        >
          <svg
            className="w-6 h-6"
            fill="none"
            stroke="currentColor"
            viewBox="0 0 24 24"
            xmlns="http://www.w3.org/2000/svg"
          >
            <path
              strokeLinecap="round"
              strokeLinejoin="round"
              strokeWidth={2}
              d="M4 6h16M4 12h16m-7 6h7"
            />
          </svg>
        </button>
      </div>

      <div
        className={`${
          isMenuOpen ? "flex" : "hidden"
        } lg:flex flex-col lg:flex-row gap-5 lg:gap-10 absolute lg:relative bg-white lg:bg-transparent w-full lg:w-auto top-full lg:top-auto left-0 lg:left-auto py-5 lg:py-0 px-10 lg:px-0 shadow-lg lg:shadow-none z-10`}
      >
        <NavLink
          to="/"
          className={({ isActive }) =>
            `flex flex-col items-center gap-1 transition-all duration-200 ${
              isActive ? "text-yellow-500" : "text-black"
            }`
          }
        >
          <p className="text-sm font-medium">Home</p>
        </NavLink>
        <NavLink
          to="/collections"
          className={({ isActive }) =>
            `flex flex-col items-center gap-1 transition-all duration-200 ${
              isActive ? "text-yellow-500" : "text-black"
            }`
          }
        >
          <p className="text-sm font-medium">Collections</p>
        </NavLink>
        <NavLink
          to="/about"
          className={({ isActive }) =>
            `flex flex-col items-center gap-1 transition-all duration-200 ${
              isActive ? "text-yellow-500" : "text-black"
            }`
          }
        >
          <p className="text-sm font-medium">About</p>
        </NavLink>
        <NavLink
          to="/contact"
          className={({ isActive }) =>
            `flex flex-col items-center gap-1 transition-all duration-200 ${
              isActive ? "text-yellow-500" : "text-black"
            }`
          }
        >
          <p className="text-sm font-medium">Contact</p>
        </NavLink>
      </div>

      <div className="flex items-center gap-6">
        <img src={searchIcon} alt="search" className="w-5 cursor-pointer" />
        <NavLink to="/cart" className="relative">
          <img src={cartIcon} alt="cart" className="w-5 cursor-pointer" />
          <div className="absolute -top-2 -right-2 w-5 h-5 bg-yellow-500 rounded-full flex items-center justify-center text-white text-xs">
            0
          </div>
        </NavLink>
        <div className="group relative">
          <img src={profileIcon} alt="profile" className="w-5 cursor-pointer" />
          <div className="hidden group-hover:block absolute right-0 mt-2 bg-white shadow-lg rounded-lg z-50">
            <div className="flex flex-col gap-2 w-36 py-3 px-5">
              <p className="cursor-pointer hover:text-yellow-500 text-sm font-medium">Profile</p>
              <p className="cursor-pointer hover:text-yellow-500 text-sm font-medium">My Orders</p>
              <p className="cursor-pointer hover:text-yellow-500 text-sm font-medium">Logout</p>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Navbar;
